import { Link } from 'react-router-dom';

const SupervisorMenu = () => (
  <nav className="bg-gray-500 text-white p-4 flex gap-6 font-medium">
    <Link to="/dashboard/supervisor" className="hover:text-yellow-300">หน้าหลัก</Link>
    <Link to="/supervisor/evaluation" className="hover:text-yellow-300">ประเมินนิสิต</Link>
    <Link to="/supervisor/profile" className="hover:text-yellow-300">โปรไฟล์</Link>
  </nav>
);

export default SupervisorMenu;
